import React, { Component } from 'react';

class ArrayTest extends Component {
    render () {
        const {buyItems} = this.state;
        return (
            <div>
                <h3>Items for sale</h3>

                <form>
                    <div>

                    </div>
                    <button>Add</button>
                </form>
                {
                    buyItems.map(item => {
                        return <p key={item}>{item}</p>
                    })
                }
            </div>
        )
    }
}

export default ArrayTest;
